import React from 'react';
import Navbar from '../components/Navbar';

const featuresList = [
    { title: "Limitless Shades and Finishes", description: "Experiment with new finishes and play with colors to find the right match for you." },
    { title: "Acne Detection", description: "Identify acne-prone areas and get tailored recommendations for your skin." },
    { title: "Personalized Recommendations", description: "Get products and routines based on your unique skin profile." },
    { title: "AI-Powered Analysis", description: "Leverage AI to analyze your skin health and suggest improvements." }
];

const FeaturesPage = () => {
    return (
        <div className="features-container py-5">
            <h2 className="text-center mb-4">Features</h2>
            <div className="row justify-content-center">
                {featuresList.map((feature, index) => (
                    <div key={index} className="col-md-6 mb-3">
                        <div className="feature-card p-4 border rounded shadow">
                            <h3>{feature.title}</h3>
                            <p>{feature.description}</p>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default FeaturesPage;
